    <div className="card">
      <div className="card-icon">{icon}</div>
      <div className="card-info">
        <p>擁有人: {owner}</p>
        <p>位置: {location}</p>
        <p>型號: {model}</p>
      </div>
    </div>
  );
};

export default Card;
